import { useFetch } from "../hooks/useFetch";


const Pokemones = () => {
  const { data, error, loading } = useFetch("https://pokeapi.co/api/v2/");
  console.log(data);

  if (loading){
    return <h2>loading...</h2>
  }
  if (error !== ''){
      return <h2> {error}   </h2>;
  }

  return (
    <div>
      <h1>Pokemones</h1>
      {
         data.map(item => (
        <h4 key={item.count}>{item.count} </h4>
      ))
      }
    </div>
  );
}

export default Pokemones
